import React from "react";
import { Component } from "react";
import logo from "../../assets/logo.png";
import styled from "styled-components";
import sign from "../../assets/$.png";
import Cart from "../../assets/Cart.png";
import Vector from "../../assets/Vector.png";
import classes from "./Navbar.module.css";
import Dropdown from "../Dropdown/Dropdown";

const Container = styled.div`
  height: 80px;
  padding-left: 100px;
  padding-right: 100px;
`;

const Wrapper = styled.div`
  padding: 10px 20px;

  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Left = styled.div`
  flex: 1;
  display: flex;
`;
const Center = styled.div`
  flex: 1;
  text-align: center;
  padding-top: 10px;
`;

const Right = styled.div`
  flex: 1;
  justify-content: flex-end;
  display: flex;
  align-items: center;
`;

const Lmenu = styled.div`
  align-items: center;
  margin-left: 40px;
`;

const Rmenu = styled.div`
  align-items: center;
  margin-right: 40px;
`;

class Navbar extends Component {
  render() {
    return (
      <Container>
        <Wrapper>
          <Left>
            <a href="">WOMEN</a>

            <Lmenu>
              <a href="">MEN</a>
            </Lmenu>
            <Lmenu>
              <a href="">KIDS</a>
            </Lmenu>
          </Left>

          <Center>
            <img src={logo} />
          </Center>
          <Right>
            <Rmenu>
              <img src={sign} />
              <img src={Vector} />
            </Rmenu>
            <Rmenu>
              <div class={classes.dropdown}>
                <button class={classes.dropbtn}>Dropdown</button>
                <div class={classes.dropdown_content}>
                  <a href="#">{Dropdown} 1</a>
                  <a href="#">Link 2</a>
                  <a href="#">Link 3</a>
                </div>
              </div>
              <img src={Cart} />
            </Rmenu>
          </Right>
        </Wrapper>
      </Container>
    );
  }
}

export default Navbar;
